import React from "react";
import { FaRegTrashAlt } from "../../../node_modules/react-icons/fa";

const MyBtn = (props) => {
  return (
    <button style={styles.myBtn}>
      {props.btnText}
      <span>
        <FaRegTrashAlt />
      </span>
    </button>
  );
};

export default MyBtn;

const styles = {
  myBtn: {
    padding: ".7rem 3.5rem",
    backgroundColor: "#1c5d99",
    color: "#fff",
    fontSize: "1rem",
    fontWeight: "bold",
    outline: "none",
    cursor: "pointer",
    width: "100%",
  },
};
